    return (
        <div className="storeReel">
            <Story image="https://www.economist.com/img/b/1280/721/90/sites/default/files/images/2015/09/blogs/economist-explains/code2.png" profileSrc={<Avatar src= "" />}/>
            <Story />
            <Story />
            <Story />
            <Story />
        </div>
    )
}

export default StoryReel
